import React from 'react';
import './HomeContent.css';

const HomeContent = () =>
{
  return (
    <div className="HomeContent">
      <h1>Welcome to the Personal Website of Pavlo Triantafyllides</h1>
      <p>
        This site is a testbed for different ideas and projects of mine. 
        I wrote it as a way to practice the react framework.</p>
        <footer>&copy; 2020 Pavlo Triantafyllides</footer>
    </div>
  );
}
